char rem_dup[50];
char *removeDuplicate(char str[], int n)
{
    // Used as index in the modified string
    int index = 0;

    // Traverse through all characters
    for (int i = 0; i < n; i++)
    {

        // Check if str[i] is present before it
        int j;
        for (j = 0; j < i; j++)
            if (str[i] == str[j])
                break;

        // If not present, then add it to
        // result.
        if (j == i)
            rem_dup[index++] = str[i];
    }
    rem_dup[index] = '\0';

    return &rem_dup[0];
}